import React, { Component } from "react";
import { Link } from "react-router-dom";
import Like from "./like";
import { getAdvisee } from "../service/userService";
import auth from "../service/authService";

class AdviseeTableBody extends Component {
  constructor(props) {
    super(props);
    console.log("advisee table body props = " + props.user);
  }
  state = {
    advisee: "",
  };
  async componentDidMount() {
    const { advisees } = this.props;
    console.log(advisees);
    var a0 = advisees[0];
    var a1 = advisees[1];
    var a2 = advisees[2];
    console.log(a0);
    console.log(a1);
    console.log(a2);

    const user = auth.getCurrentUser();
    var userId = user._doc._id;
    console.log(userId);
    const { data } = await getAdvisee(userId, a0);
    this.setState({ advisee: data });

    console.log("state = " + this.state);
  }
  render() {
    const { advisees } = this.props; //this.props.people
    console.log(advisees);

    return (
      <tbody>
        {advisees.map((advisee, index) => (
          <tr key={index}>
            <td>{advisee.lName}</td>
            <td>{advisee.fName}</td>
            <td>
              <Link to={`/student`}> {advisee.studentID} </Link>
            </td>
          </tr>
        ))}
      </tbody>
    );
  }
}

// ${advisee.studentID}

export default AdviseeTableBody;
